:root {
 /* 模拟手机屏幕的宽度和高度 */
 --screen-width: 350px;
 --screen-height: 650px;

 /* 背景色: 用于卡片、弹窗等 */
 --secondary-bg: #ffffff;

 /* 边框颜色: 用于分割线 */
 --border-color: #e0e0e0;

 /* 主要文字颜色: 用于标题和正文 */
 --text-primary: #1f1f1f;

 /* 次要文字颜色: 用于提示和时间戳 */
 --text-secondary: #8a8a8a;

 /* 主题强调色: 用于可交互元素 */
 --accent-color: #1f1f1f;

 /* --- 可调节项 --- */
 /* 【修改】压扁顶栏高度 */
 --header-height: 50px;  
 /* 【修改】因为高度变小了，不需要额外的顶部padding也能居中 */
 --header-text-padding-top: 0px; 
}

/* --- 消息间距 --- */
#chat-messages {
    gap: 2px !important;
    /* 【核心修改】防止内容被悬浮的顶栏底栏遮挡 */
    padding-top: 90px !important; 
    padding-bottom: 20px !important;
}
.message-wrapper {
    margin-bottom: 4px !important;
}

/* B. 顶部与底部栏 */
/* --- 1. 聊天界面顶部导航栏 --- */
#chat-interface-screen .header {
    background-image: none !important;
    background-color: #ffffff !important;
    height: var(--header-height) !important;
    border-bottom: none !important;
