/* =================================================================== /
/ C. 聊天内容区 (最终修正版 - 强制紧贴)                                 /
/ =================================================================== */

/* 1. 【关键】移除父容器可能存在的默认间距 */
#chat-messages, .chat-body {
    display: flex !important;
    flex-direction: column !important;
    gap: 4px !important;
}

/* 2. 隐藏头像 */
.message-bubble .avatar {
    opacity:0 !important; 
    width: 0 !important;
    height: 0 !important;
    margin: 0 !important;
}

    /* 默认：不同人说话时，拉开距离 */
    margin-top: 35px !important; 
}

/* 4. 第一条消息顶部不需要间距 */
.message-wrapper:first-child {
    margin-top: 10px !important;
}

/* 5. 【核心】同类消息紧贴 (利用 + 选择器) */
/* 如果 AI 接着 AI 说话：间距变为 2px */
.message-wrapper.ai + .message-wrapper.ai {
    margin-top: 2px !important; 
}
/* 如果 User 接着 User 说话：间距变为 2px */
.message-wrapper.user + .message-wrapper.user {
    margin-top: 2px !important; 
}

/* 6. 隐藏时间戳 */
.timestamp {
    display: none !important;
}

/* 7. 【智能尾巴】只在最后一条显示 */
/* 逻辑：如果当前消息后面紧跟着同类消息，这就不是最后一条，隐藏尾巴 */
.message-wrapper.ai:has(+ .message-wrapper.ai) .content::after {
    display: none !important;
}
.message-wrapper.user:has(+ .message-wrapper.user) .content::after {
    display: none !important;
}

* 7. 默认隐藏所有时间戳 */
.timestamp {
    display: none !important;
}

/* 8. 【关键】只在 User 的“最后一条”消息下显示时间戳 */
/* 逻辑：如果当前是 User 消息，且后面“没有”紧跟另一条 User 消息，显示！*/
.message-wrapper.user:not(:has(+ .message-wrapper.user)) .timestamp {
    display: flex !important;
