/* =================================================================== */
/* C. 聊天内容区                                                       */
/* =================================================================== */
.message-wrapper { position: relative; margin-bottom: 1px; }

.timestamp {
  position: absolute;
  font-size: 11px;
  color: var(--text-secondary);
  white-space: nowrap;
  display: flex;
  align-items: center;
  gap: 4px;
  bottom: -20px;
}
.message-wrapper.ai .timestamp { left: 56px; }
.message-wrapper.user .timestamp { right: 50px; }

.message-wrapper.user .timestamp::before {
  content: 'Delivered';
  position: static;
  font-size: 11px;
  color: var(--text-secondary);
  font-weight: 400;
}

/* 🌰头像 */
.message-bubble .avatar {
  width: 33px !important;
  height: 33px !important;
  border-radius: 50%;
  border: 1px solid #e0c4c4;
}

/* 气泡样式 */
.message-wrapper {
 display: flex; align-items: flex-end; gap: 8px;
}
.message-bubble .content {
 position: relative;
 max-width: 95%;
 padding: 7px 13px;
 line-height: 1.3;
 word-break: break-word;
 border-radius: 18px!important;
 border: 1.4px solid #e0c4c4;
 box-shadow: 0 2px 3px rgba(0, 0, 0, 0.05);
 overflow: visible;
 z-index: 1!important;
}

/* 高光 */
.message-bubble .content::before {
    content: '';
    position: absolute;
    top: 2px;
    width: 85% !important;
    left: 50% !important;
    transform: translateX(-50%) !important;
    height: 10px;
    border-radius: 100px !important;
    clip-path: none !important; 
    background: linear-gradient(to bottom, rgba(255, 255, 255, 0.9), rgba(255, 255, 255, 0));
    filter: blur(1px);
    pointer-events: none;
    z-index: 2;
}

/* AI气泡 */
.message-bubble.ai .content {
 background-color: #f9f0f0;
 background-image: linear-gradient(to bottom, #f0e0e0, #ffffff);
 color: #7a6a6a;
}
/* 用户气泡 */
.message-bubble.user .content {
 background-color: #ffd6e0;
 background-image: linear-gradient(to bottom, #ffc8d6, #ffe6ed);
 color: #7a6a6a;
}

/* 🌰气泡尾巴 */
.message-bubble .content::after {
  content: '';
  position: absolute;
  width: 15px; height: 15px;
  background-size: contain;
  background-repeat: no-repeat;
  z-index:-1!important;
}
.message-bubble.user .content::after {
  bottom: -3px; right: -7px;
  background-image: url('https://i.postimg.cc/Wp0xYtX0/test1_(1).png');
}
.message-bubble.ai .content::after {
  bottom: -4px; left: -6.8px;
  background-image: url('https://i.postimg.cc/jSCGqc4w/IMG-2867.png');
}

.message-bubble::before { display: none !important; }

/* 引用与语音颜色 */
.message-bubble.ai.quoted-message, .message-bubble.ai .voice-transcript { color: #5a4a4a !important; }
.message-bubble.ai .quoted-message .quoted-sender { color: var(--text-secondary) !important; }
.message-bubble.ai .quoted-message { border-left-color: #f0e0e0 !important; }

.message-bubble.user .quoted-message, .message-bubble.user .voice-transcript,
.message-bubble.user .quoted-message .quoted-sender,
.message-bubble.user .quoted-message .quoted-content { color: #7a6a6a !important; }
.message-bubble.user .quoted-message { border-left-color: #ffe6ed !important; }

.message-bubble.ai .voice-message-body, .message-bubble.ai .voice-duration { color: #7a6a6a; }
